fee24h = 14500

def getfee(tickrange):
    call_data = quoter_contract.encodeABI(
        fn_name="quoteExactInputSingle",
        args=[
            token_in,
            token_out,
            feePool,
            amount_in,
            0
        ]
    )

    result = web3.eth.call({
        'to': quoter,
        'data': call_data
    })

    amount_out = int(result.hex(), 0)

    tick = pool.functions.slot0().call()[1]

    tickLower = tick - tickrange
    tickUpper = tick + tickrange

    remainder0 = tickLower % 10
    remainder1 = tickUpper % 10
    if remainder0 < 5:
        tickLower = tickLower - remainder0
    else:
        tickLower = tickLower + 10 - remainder0
    if remainder1 < 5:
        tickUpper = tickUpper - remainder1
    else:
        tickUpper = tickUpper + 10 - remainder1


    sqrtRatio = calculator.functions.getSqrtRatio(tick).call()

    if pool.functions.token0().call() == token_out:
        liquidity = calculator.functions.liquidityForAmounts(sqrtRatio, amount_out, amount_in, tickLower,
                                                             tickUpper).call()
    else:
        liquidity = calculator.functions.liquidityForAmounts(sqrtRatio, amount_in, amount_out, tickLower,
                                                             tickUpper).call()

    liquidityOf = pool.functions.liquidity().call()

    fee = fee24h * (liquidity / (liquidityOf + liquidity))
    return fee

